import React, { Component } from "react";

class Users extends Component {
  constructor() {
    super();
    this.state = {
      users: []
    };
  }

  render() {
    return (
      <div className="container">
        <h2 className="mt-5 mb-5">Users</h2>
      </div>
    );
  }
}

export default Users;
